// screens/FlightListScreen.js
import React from 'react';
import { View, Text } from 'react-native';

const FlightListScreen = ({ route }) => {
  const { departure, destination, departureDate } = route.params;

  return (
    <View>
      <Text>Daftar Jadwal Pesawat dari {departure} ke {destination} pada tanggal {departureDate}</Text>
      {/* daftar jadwal pesawat yang sesuai dengan parameter */}
    </View>
  );
}

export default FlightListScreen;
